import React, { Component } from 'react';
import {connect} from 'react-redux';

class Comp2 extends Component {

    constructor(props){
        super(props);
        this.state={arr:[]}
    }

    componentDidUpdate(){

        return true;
    }

    render() {
        var users = this.props.data.userArr.map((item,index)=>{
            return<li key={index}>name:{item.name} , age:{item.age}</li>
        }) ;


        return (
            <div className="">
                {this.props.data.counter}
                <br/>
                {users}
            </div>
        );
    }}

const mapStateToProps = (state)=>{
    return{
        data:state
    }


};

export default connect(mapStateToProps)(Comp2);
